import React, {Component} from 'react';
import {Form,
        Container,
        Row,
        Col,
        Card,
        Button} from 'react-bootstrap';

class LoginComponent extends Component {

  constructor(props){
    super(props);

    this.state = {
      username:'',
      password:''
    }

    this.handleSubmit = this.handleSubmit.bind(this);
    this.handleUsernameChange = this.handleUsernameChange.bind(this);
    this.handlePasswordChange = this.handlePasswordChange.bind(this);

  }

  handleSubmit(event){
    event.preventDefault();

    console.log('Submitted');

    /*
    const response = fetch('http://localhost:8080/')
                     .then(response=>{if(response.ok){
                        return response.json();
                     }else{
                       throw new Error('Error in LoginComponent.js, Network response not ok');
                     }}).then(json => {this.setState({events:json})});
    */
    //depending on whether response is okay,
    //set local storage boolean keeping track of login to true along with user id

    this.setState({
      username:'',
      password:''
    })
  }

  handleUsernameChange(event){
    this.setState({username:event.target.value});
  }

  handlePasswordChange(event){
    this.setState({password:event.target.value});
  }

  render(){
    return (
      <div>
        <Form onSubmit={this.handleSubmit}>
          <Form.Group>
            <Form.Label>Username</Form.Label>
            <Form.Control value={this.state.username} onChange={this.handleUsernameChange}></Form.Control>
          </Form.Group>
          <Form.Group>
            <Form.Label>Password</Form.Label>
            <Form.Control value={this.state.password} onChange={this.handlePasswordChange}></Form.Control>
          </Form.Group>
          <Button variant="primary" type="submit">
            Log in
          </Button>
        </Form>
     </div>
    )
  }
}

export default LoginComponent;
